$(document).ready(function(){console.log("loaded");$("#login-toggler").click(function(a){$("#first-login-view").addClass("hidden");$("#second-login-view").removeClass("hidden");a.preventDefault()});$(".checkmark").click(function(a){if($(this).hasClass("blue")){$(this).removeClass("blue");console.log("removed class")}else{$(this).addClass("blue");console.log("added class")}a.preventDefault()});$("#mounth").each(function(){var f=$(this),a=$(this).children("option").length;f.addClass("select-hidden");f.wrap('<div class="select"></div>');f.after('<div class="select-styled"></div>');var e=f.next("div.select-styled");e.text(f.children("option").eq(0).text());var b=$("<ul />",{"class":"select-options"}).insertAfter(e);for(var d=0;d<a;d++){$("<li />",{text:f.children("option").eq(d).text(),rel:f.children("option").eq(d).val()}).appendTo(b)}var c=b.children("li");e.click(function(g){g.stopPropagation();$("div.select-styled.active").not(this).each(function(){$(this).removeClass("active").next("ul.select-options").hide()});$(this).toggleClass("active").next("ul.select-options").toggle()});c.click(function(g){g.stopPropagation();e.text($(this).text()).removeClass("active");f.val($(this).attr("rel"));b.hide()})})});